import React from 'react';
import './Blog.css'
import B1 from './B1.jpg'
import B2 from './B2.jpg'
import B3 from './B3.jpg'
import B4 from './B4.jpg'
function Blog(){
    return (
        <div className="blog">
           <div className="row row animate__animated animate__zoomIn">
             <div className="column">
                 <img src={B1} alt="img" />
                 <img src={B2} alt="img" />
             </div>
             <div className="column">
                 <img src={B3} alt="img" />
                 <img src={B4} alt="img"/>
             </div>
           </div>
        </div>
    );
}

export default Blog;
